import React from "react";
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import './styles/work.css';

let work = [
	{
		employer: "eKlozet",
		location: "Atlanta, GA",
		date: "August 2022 - December 2022",
		title: "Client-Facing Software Developer",
		description: "As a Client-Facing Software Developer for eKlozet, I collaborated with a team of student developers to create a sustainable fashion iOS mobile app for client Tanjuria Willis. My contributions included developing a collaborative-filtering algorithm for personalized outfit recommendations and designing a SQL database to manage user CRUD functionality, ultimately serving 10,000+ users. Additionally, I proficiently used Git/GitHub for code versioning, playing a role in coordinating team responsibilities, ensuring the successful completion of sprints and feature delivery."
	}
]

const Work = () => {
	  return (
		<div className="work_container">
			<div className="work_title">/experience</div>
			<div className="work_tabs_container">
				<div className="my_work">
				As a Client-Facing Software Developer for eKlozet,
				I collaborated with a team of student developers to create a 
				sustainable fashion iOS mobile app for client Tanjuria Willis. My contributions 
				included developing a <strong style={{color: 'white'}}>collaborative-filtering algorithm</strong> for 
				personalized outfit recommendations and designing a <strong style={{color: 'white'}}>SQL database</strong> to 
				manage user CRUD functionality, ultimately serving <span style={{color: 'white'}}>10,000+</span> users. 
				Additionally, I proficiently used Git/GitHub for code versioning, playing a role in coordinating team 
				responsibilities, ensuring the successful completion of sprints and feature delivery.
				</div>
			</div>
		</div>
	  )
}

export default Work;
